import React, { useState } from "react";
import { postTimeHistory } from "../../api/timeHistory";

export default function FormTimeHistory(props: any) {
  const [response, setResponse] = useState();

  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  const createTimeHistory = async () => {
    return await postTimeHistory(
      props.projectId,
      new Date(startDate),
      new Date(endDate)
    )
      .then((res) => res.json())
      .then((data) => {
        setResponse(data);
        console.log(response);
      });
  };

  return (
    <>
      <form>
        <div className="row">
          <div className="col-6">
            <label>Strat Date</label>
            <input
              type="datetime-local"
              className="form-control"
              min={new Date()
                .toISOString()
                .slice(0, new Date().toISOString().lastIndexOf(":"))}
              onChange={(e) => setStartDate(e.target.value)}
            />
          </div>
          <div className="col-6">
            <label>End Date </label>
            <input
              type="datetime-local"
              className="form-control"
              min={new Date()
                .toISOString()
                .slice(0, new Date(date.getTime() + minutes*60000).toISOString().lastIndexOf(":"))}
              onChange={(e) => setEndDate(e.target.value)}
            />
          </div>
        </div>
        <br></br>
        <div className="row">
          <div className="form-group">
            <button
              className="btn btn-primary"
              onClick={() => createTimeHistory()}
            >
              Create
            </button>
          </div>
        </div>
      </form>
    </>
  );
}
